import React from "react";
import Input from "./Input";

class Form extends React.Component {

  onSubmit = () => {}

  render() {
    return(
      <form onSubmit={this.onSubmit}>
        <Input name="Логин" type="text"/>
        <Input name="Пароль" type="password"/>
      </form>
    )
  }
}

export default Form;
